  const{data, error, loading} = Useapi('https://fakestoreapi.com/products/1');
  if(loading) return <h3>Loading......</h3>;

  if (error) return <h3>We know something went wrong, we are taking care of that.</h3>
  console.log (data);
 
  return(
    <>
    <h1>hi{data.title}</h1>
    <Card
    //  image={data.image}
    //  title={data.title}
     price={data.price}   
    
    />
    </>
    
  )
  
}


function Main(){

  
    return (
      <div className="bdy">
      <div className='banner'>
        <img src={Image}></img>  
        </div>
        {/* <Card /> */}
      
      </div>
    
  
    )
  }

  export default Main;
